CREATE TABLE [dbo].[Paciente] (
    [Id] [int] NOT NULL IDENTITY,
    [Nombre] [nvarchar](max),
    [Identificacion] [nvarchar](max),
    [Edad] [int] NOT NULL,
    [DatosContacto] [nvarchar](max),
    [UltimaConsulta] [datetime] NOT NULL,
    [ProximaConsulta] [datetime] NOT NULL,
    CONSTRAINT [PK_dbo.Paciente] PRIMARY KEY ([Id])
)
CREATE TABLE [dbo].[Tratamiento] (
    [Id] [int] NOT NULL IDENTITY,
    [FechaInicio] [datetime] NOT NULL,
    [FechaConclusion] [datetime] NOT NULL,
    [Costo] [float] NOT NULL,
    [Detalle] [nvarchar](max),
    [Paciente_Id] [int],
    CONSTRAINT [PK_dbo.Tratamiento] PRIMARY KEY ([Id])
)
CREATE INDEX [IX_Paciente_Id] ON [dbo].[Tratamiento]([Paciente_Id])
ALTER TABLE [dbo].[Tratamiento] ADD CONSTRAINT [FK_dbo.Tratamiento_dbo.Paciente_Paciente_Id] FOREIGN KEY ([Paciente_Id]) REFERENCES [dbo].[Paciente] ([Id])
CREATE TABLE [dbo].[__MigrationHistory] (
    [MigrationId] [nvarchar](150) NOT NULL,
    [ContextKey] [nvarchar](300) NOT NULL,
    [Model] [varbinary](max) NOT NULL,
    [ProductVersion] [nvarchar](32) NOT NULL,
    CONSTRAINT [PK_dbo.__MigrationHistory] PRIMARY KEY ([MigrationId], [ContextKey])
)
